-- Table principale partitionn√©e par LIST(id_kpi)
DROP TABLE IF EXISTS kpi_crm_value CASCADE;

CREATE TABLE kpi_crm_value (
    id SERIAL,
    id_kpi INT NOT NULL,
    id_responsable INT,
    value_date DATE,
    value numeric,
    PRIMARY KEY (id_kpi, id_responsable, value_date)
) PARTITION BY LIST (id_kpi);



-- Generate commands in psql
DO
$$
DECLARE
    kpi_id INT;
    y INT;
    m INT;
    start_date DATE;
    end_date DATE;
    table_name TEXT;
BEGIN
-- number of partitions representing each kpi. If 50 kpi then we loop from 1 to 50
    FOR kpi_id IN 1..50 LOOP
        EXECUTE format(
            'CREATE TABLE kpi_crm_value_kpi_%s PARTITION OF kpi_crm_value FOR VALUES IN (%s) PARTITION BY RANGE (value_date);',
            kpi_id, kpi_id
        );

-- from date until date to create the partitions
        FOR y IN 2023..2030 LOOP
-- one partition per month
            FOR m IN 1..12 LOOP
                start_date := make_date(y, m, 1);
                end_date := (start_date + interval '1 month')::date;
                table_name := format('kpi_crm_value_kpi_%s_%s_%s', kpi_id, y, lpad(m::text,2,'0'));

                -- Instead of EXECUTE directly we PRINT the commands in the console so we can execute them in a separate script
                RAISE NOTICE '%', format(
                    'CREATE TABLE %I PARTITION OF kpi_crm_value_kpi_%s FOR VALUES FROM (%L) TO (%L);',
                    table_name, kpi_id, start_date, end_date
                );
            END LOOP;
        END LOOP;
    END LOOP;
END;
$$;


